import React from 'react';
import '../../style/CreateNewSet.css';
import Word from './Word';


function WordSet(wordSet) {
    return (
        <div className='word_set'>
            {wordSet.words.map(elem => <Word key = {elem.id} item={elem}/>)}
        </div>
    )
}

export default WordSet;
